def convert_dollar_to_float(dollars, inplace=True):

    if not inplace:
        dollars = dollars.copy()

    dollars.fillna('$0', inplace=True)
    dollars.replace(r'\$', '', regex=True, inplace=True)
    dollars = dollars.astype('float32', copy=False)

    if not inplace:
        return dollars

