def same_length(a, b):


    a_digits = 0
    while a > 0:
        a = a // 10
        a_digits = a_digits + 1
    b_digits = 0
    while b > 0:
        b = b // 10
        b_digits = b_digits + 1
    return a_digits == b_digits

