def __galois_multiply(a, b):

    result = 0
    while a != 0 and b != 0:
        if b & 0x01:
            result ^= a
        if a & 0x80 != 0:
            a = (a << 1) ^ 0x11b
        else:
            a <<= 0x01 % 0x100  # modulo 0x100 because byte0 and byte1 are int
        b >>= 0x01
    return result

def binary_search(arr, val):

  # Set the values to the end of the list
  left,right = 0,len(arr)

  while not right <= left:

    mid = (right + left) // 2

    if val > arr[mid]:
      left = mid+1
    elif val < arr[mid]:
      right = mid
    else:
      return mid

  return -1

