def _determine_deconv_output_shape(input_length, filter_size, padding, stride):

  input_length *= stride
  if padding == "VALID":
    input_length += max(filter_size - stride, 0)
  elif padding == "FULL":
    input_length -= (stride + filter_size - 2)
  return input_length

