def humanize_bytes(num_bytes):

    val = num_bytes
    suffix = "B"
    factor = 1000
    if val >= factor:
        val = val / factor
        suffix = "KB"
    if val >= factor:
        val = val / factor
        suffix = "MB"
    if val >= factor:
        val = val / factor
        suffix = "GB"
    val = "{:0.1f} {}".format(val, suffix)
    return val.replace(".0", "")

def median(numbers):

    numbers.sort()
    if len(numbers) % 2 == 1:
        median = numbers[-round(-len(numbers) / 2)]
        median = round(median, 1)
    else:
        median = (
            numbers[int(len(numbers) / 2)] + numbers[int(len(numbers) / 2 - 1)]
        ) / 2
        median = round(median, 1)
    return median

