def get_position(x:int, y:int, direction:int, distance:int=1) -> (int,int):

    if (direction == 0):
        return (x, y-distance)
    elif (direction == 1):
        return (x+distance, y)
    elif (direction == 2):
        return (x, y+distance)
    elif (direction == 3):
        return (x-distance, y)
    else:
        print(f"Error, invalid direction {direction} not in range [0:4]")
