def parse_bool(arg):

    if isinstance(arg, bool):
        return arg
    if arg is None:
        return False
    if arg.lower() in ['1', 'true', 't', 'yes', 'y']:
        return True
    if arg.lower() in ['0', 'false', 'f', 'no', 'n', 'none', 'null']:
        return False
    raise ValueError(f'`{arg}` cannot be converted to boolean!')

